package main

import "fmt"

/**
https://leetcode.cn/problems/move-pieces-to-obtain-a-string/
*/
func canChange(start string, target string) bool {
	n := len(start)

	var tr, tl [][]int
	var x, y int
	for i := n - 1; i >= 0; i-- {
		switch target[i] {
		case 'R':
			tr = append(tr, []int{i, y})
			y = 0
		case 'L':
			y = 0
		case '_':
			y++
		}
		switch start[i] {
		case 'L':
			x = 0
		case '_':
			x++
		case 'R':
			if len(tr) == 0 {
				return false
			}
			j, k := tr[0][0], tr[0][1]
			tr = tr[1:]
			if j-i > x-k {
				return false
			}
			x -= k
		}
	}

	x, y = 0, 0
	for i := 0; i < n; i++ {
		switch target[i] {
		case 'L':
			tl = append(tl, []int{i, y})
			y = 0
		case 'R':
			y = 0
		case '_':
			y++
		}

		switch start[i] {
		case 'L':
			if len(tl) == 0 {
				return false
			}
			j, k := tl[0][0], tl[0][1]
			tl = tl[1:]
			if i-j > x-k {
				return false
			}
			x -= k
		case '_':
			x++
		case 'R':
			x = 0

		}
	}

	fmt.Println(tr, tl)
	return len(tr) == 0 && len(tl) == 0
}

